function showOne() {
    if (typeof showElement != 'undefined' && showElement != false) {
        $("#menu-showall").find('input').click();


        var arLayers = showElement[0].split(',');
        for(var i in arLayers) {
            var swither = null;
            switch (arLayers[i].toUpperCase()) {
                case 'CHAMBERS_NOT_MUNICIPAL':
                    swither = $('#menu-tpps-non-municipal');
                    break;
                case 'CHAMBERS_MUNICIPAL':
                    swither = $('#menu-tpps-municipal');
                    break;
                case 'RU_EXH_CENTERS':
                    swither = $('#menu-deivistcompl');
                    break;
                case 'SUBCONTRACTING_CENTERS':
                    swither = $('#menu-subcontracting-centers');
                    break;
                case 'SOEX':
                    swither = $('#menu-soiuzexpertiza');
                    break;
                case 'BUSINESS_COUNCILS':
                    swither = $('#menu-deloviesovety');
                    break;
                case 'COURTS':
                    swither = $('#menu-treteiskiesudi');
                    break;
                case 'MISSIONS':
                    swither = $('#menu-zagranpredstva');
                    break;
                case 'MEDIATION':
                    swither = $('#menu-mediation');
                    break;
            }
            swither.find('input').click();
        }


        var geo = geos[showElement[1]];
        if (!geo) return;

        var coords = geo.COORDINATES;
        if (!coords) return;

        gotoPlace(coords[0], coords[1]);
    }
}

var YaMap;
var menuOptions = [];
var mapGroupIdGeoObject = {};
